import "./App.css";
import NavBar from "./components/NavBar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HeroSection from "./components/HeroSection";
import Footer from "./components/Footer";

function App() {
  return (
    <Router>
      <NavBar></NavBar>
      <HeroSection />
      <Footer />
      <Routes>
        <Route path="/" exact />
      </Routes>
    </Router>
  );
}

export default App;
